import React, { useState } from "react";
import "./app.css";

// Import all components that actually exist
import Chat from './components/Chat';
import './components/Chat.css';
import AICoach from './components/AICoach';
import Therapy from './components/Therapy';
import Community from './components/Community';
import Report from './components/Report';
import Profile from './components/Profile';
import GamesModal from './components/GamesModal';
import AICoachModal from './components/AICoachModal';
import SleepCompanionModal from './components/SleepCompanionModal';
import MoodReportModal from './components/MoodReportModal';
import BreathingExercise from './components/BreathingExercise';
import Journal from './components/Journal';
import Shop from './components/Shop';

function App({ user, onLogout, onUpdateUser }) {
    const [activeTab, setActiveTab] = useState("chat");
    
    // Modal Visibility State
    const [showGamesModal, setShowGamesModal] = useState(false);
    const [showBreathing, setShowBreathing] = useState(false);
    const [showAICoachModal, setShowAICoachModal] = useState(false);
    const [showSleepCompanion, setShowSleepCompanion] = useState(false);
    const [showMoodReport, setShowMoodReport] = useState(false);

    const handleUpdateUser = (updatedData) => {
        const newUserData = { ...user, ...updatedData };
        if (onUpdateUser) {
            onUpdateUser(newUserData);
        }
    };

    return (
        <div className={`app-container ${user.currentTheme || 'default'}-theme`}>
            <header className="app-header">
                <div className="header-left">
                    <h1>üåô MoodMate</h1>
                    <span className="status-indicator">Online - Ready to listen</span>
                </div>
                <div className="header-right">
                    <div className="user-stats">
                        <span className="streak-display">üî• {user.streak || 0}</span>
                        <span>ü™ô {user.coins || 0}</span>
                        {user.is_premium ? (
                            <span className="premium-indicator">üåü Premium</span>
                        ) : (
                            <span className="premium-indicator-locked">üíé Basic</span>
                        )}
                    </div>
                    <div className="user-info">
                        <span className="user-name">{user.username}</span>
                    </div>
                    <button onClick={onLogout} className="logout-btn">Logout</button>
                </div>
            </header>
            
            <nav className="app-nav">
                <button 
                    className={activeTab === "chat" ? "active" : ""} 
                    onClick={() => setActiveTab("chat")}
                >
                    üí¨ Chat
                </button>
                <button 
                    className={activeTab === "ai-coach" ? "active" : ""} 
                    onClick={() => setActiveTab("ai-coach")}
                >
                    ü§ñ AI Coach
                </button>
                <button 
                    className={activeTab === "therapy" ? "active" : ""} 
                    onClick={() => setActiveTab("therapy")}
                >
                    üë®‚Äç‚öïÔ∏è Therapy
                </button>
                <button 
                    className={activeTab === "community" ? "active" : ""} 
                    onClick={() => setActiveTab("community")}
                >
                    üåç Community
                </button>
                <button 
                    className={activeTab === "report" ? "active" : ""} 
                    onClick={() => setActiveTab("report")}
                >
                    üìä Report
                </button>
                <button 
                    className={activeTab === "profile" ? "active" : ""} 
                    onClick={() => setActiveTab("profile")}
                >
                    üë§ Profile
                </button>
            </nav>

            <main className="app-main">
                {activeTab === 'chat' && <Chat user={user} />}
                {activeTab === 'ai-coach' && <AICoach user={user} />}
                {activeTab === 'therapy' && <Therapy user={user} onUpdateUser={handleUpdateUser} />}
                {activeTab === 'community' && <Community user={user} />}
                {activeTab === 'report' && <Report user={user} />}
                {activeTab === 'profile' && (
                    <Profile 
                        user={user} 
                        onUpdateUser={handleUpdateUser}
                        onShowReport={() => setShowMoodReport(true)}
                        onShowGames={() => setShowGamesModal(true)}
                        onShowBreathing={() => setShowBreathing(true)}
                        onShowSleep={() => setShowSleepCompanion(true)}
                        onShowAICoach={() => setShowAICoachModal(true)}
                        onShowJournal={() => {/* Journal is now a tab, not a modal */}}
                        onShowShop={() => {/* Shop is now in Profile, not a modal */}}
                    />
                )}
            </main>

            {/* All top-level Modals */}
            {showGamesModal && (
                <GamesModal 
                    user={user} 
                    onClose={() => setShowGamesModal(false)}
                />
            )}
            {showAICoachModal && (
                <AICoachModal 
                    user={user} 
                    onClose={() => setShowAICoachModal(false)}
                />
            )}
            {showSleepCompanion && (
                <SleepCompanionModal 
                    user={user} 
                    onClose={() => setShowSleepCompanion(false)}
                />
            )}
            {showMoodReport && (
                <MoodReportModal 
                    user={user} 
                    onClose={() => setShowMoodReport(false)}
                />
            )}
            
            {showBreathing && <BreathingExercise onClose={() => setShowBreathing(false)} />}
        </div>
    );
}

export default App;
